CREATE FUNCTION public.basename(text) RETURNS text
    LANGUAGE plpgsql
    AS $_$
declare
    FILE_PATH alias for $1;
    ret         text;
begin
    ret := regexp_replace(FILE_PATH,'^.+[/\\]', '');
    return ret;
end;
$_$;


