-- Name: f_cpsmidinn(real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.f_cpsmidinn(note real) RETURNS real
    LANGUAGE plpgsql
    AS $$
/*
 * Return the frequency in Hz for a MIDI note number
 */
begin
    return pow(2, (note - 69) / 12) * 440;
end;
$$;


