--
-- Name: f_nearestnote(real, integer); Type: FUNCTION; Schema: public; Owner: kane
--

CREATE FUNCTION public.f_nearestnote(v_note real, v_collectionid integer) RETURNS TABLE(file_id integer, path text, channels integer, duration real, rmsnormal double precision, samplerate integer, pitchratio real)
    LANGUAGE plpgsql
    AS $$
begin

	return query
	select 
		a.file_id, 
		a.path, 
		a.channels, 
		a.duration, 
		a.rmsnormal, 
		a.samplerate, 
		f_cpsmidinn(v_note) / f_cpsmidinn(note::real) pitchratio 
	from svw.analysis_basic_collectionnorm a 
	join filecollection fc on fc.id = a.filecollection_id 
	where fc.id = v_collectionid
	order by abs(v_note-note), random()
	limit 1;


end;
$$;


ALTER FUNCTION public.f_nearestnote(v_note real, v_collectionid integer) OWNER TO kane;

