--
-- Name: analysis_basic_collectionnorm; Type: MATERIALIZED VIEW; Schema: svw; Owner: partialemergence
--

CREATE MATERIALIZED VIEW svw.analysis_basic_collectionnorm AS
 WITH analyses AS (
         SELECT an_1.file_id,
            ((an_1.analysis ->> 'rms.mean'::text))::double precision AS rms,
            ((an_1.analysis ->> 'pitch.mean'::text))::double precision AS pitch,
            ((an_1.analysis ->> 'centroid.mean'::text))::double precision AS centroid
           FROM public.analysis an_1
        ), rmsminmax AS (
         SELECT min(analyses.rms) AS rmsmin,
            max(analyses.rms) AS rmsmax
           FROM analyses
        )
 SELECT f.id AS file_id,
    fcr.filecollection_id,
    f.path,
    s.channels,
    s.duration,
    ((((1)::double precision / (r.rmsmax - r.rmsmin)) * (an.rms - r.rmsmin)) + r.rmsmin) AS rmsnormal,
    COALESCE(an.pitch, (0)::double precision) AS pitch,
    COALESCE(an.centroid, (0)::double precision) AS centroid,
    m.note,
    s.samplerate
   FROM (((((public.file f
     JOIN rmsminmax r ON ((1 = 1)))
     LEFT JOIN public.filecollectionrelation fcr ON ((fcr.file_id = f.id)))
     LEFT JOIN public.sound s ON ((s.file_id = f.id)))
     LEFT JOIN analyses an ON ((an.file_id = f.id)))
     LEFT JOIN public.melsound m ON ((m.file_id = f.id)))
  WITH NO DATA;


ALTER TABLE svw.analysis_basic_collectionnorm OWNER TO partialemergence;

